'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/docs/example/','title':"Home",'content':" h2event{ color: #3273DC;display: inline-block; border: 1px solid #7594B4; border-radius: 25px; padding: 10px 15px 10px 15px }   About us Several members of the committee helped to organize the very successful 19th Annual Meeting of the Chinese Life Scientists Society in the UK which took place in Oxford in 2013 (for details, please click here). They believed that a permanent platform was needed for Chinese life scientists in Oxford to meet regularly and exchange ideas, and therefore established this society.\nThe aims of this society are:\n To bring together researchers with different areas of expertise in life sciences in Oxford To provide a platform for Chinese life scientists in Oxford to meet, exchange ideas and establish research collaborations  We welcome anyone working in life sciences in Oxford to join us!\nCommittee  Advisors (in surname order): Prof. Zhanfeng Cui, Prof Tao Dong, Dr Shisong Jiang, Dr Jilong Liu Committee Members (in surname order): Dr Leyuan Bao, Ms Elizabeth Huang, Dr Yuan Jenq Lui, Dr Yingjie Wang, Mr Hanlin Zhang  "});index.add({'id':1,'href':'/docs/Recruit/','title':"招新",'content':"【OCLSS招新】2020-21牛津华人生命科学协会招新   1.组织介绍 OCLSSS（牛津华人生命科学协会）成立于2013年，由生命科学学生学者共同组成，致力于为生命科学相关学科的学者和学生们打造高水准的学术交流平台。其集结学术大牛，促进大家交流合作、分享最新科研动态，使学术交流畅通无阻。\n作为牛津大学生命科学领域最大的华人组织，本协会致力于构建连接牛津地区生命科学学者学生的交流的桥梁，打造良好科研交流平台，积极承办开展学术会议，开展学术讨论。目前的活动多集中在Headington, 也非常欢迎在South Park附近工作学习的同学能加入我们，共同完善这一学术交流平台。于此同时，协会亦会安排娱乐活动，为大家工作之余增添乐趣。。\n在疫情期间，为了帮助祖国抗击新冠疫情，OCLSS募集资金约1300磅、与全英清华校友会通力合作购买医护用品驰援祖国，为祖国奉献了牛津学生学者的绵薄之力。\n近期由本协会承办的第26届英国华人生命科学协会年度会议于9月19日圆满举行，由于疫情影响，该会议在ZOOM上举办，共超过300名来自中英两国的生命科学领域包括皇家科学院/工程学院院士、教授、学者、学生及相关产业从业人员参会。同时我们有幸邀请了中国驻英大使馆科技处公使衔参赞蒋苏南先生，大使馆教育处一等秘书王静女士和牛津大学路德维格癌症研究所所长皇家科学院及医学院院士卢欣教授出席开幕式并致辞。\n全英华人生命科学年会线上会议截图\n除了学术会议这类大型活动外OCLSS更多是举办一些定期的小型茶歇分享会/研讨会。届时我们邀请老师或同学分享自己的学术经验和职业相关技能。\n茶歇分享会\n新闻稿写作撰写技巧分享\n除了为广大学生学者组织丰富的学术活动，我们同时还兼顾工作学习之余的娱乐活动，如元宵联欢晚会、春游、BBQ、篮球比赛等\n元宵联欢晚会留影\n户外烧烤\n2.部门介绍 宣传部 宣传部是OCLSS与外部连接最重要的桥梁，需要负责运营OCLSS的社交媒体账号，包括微信公众号、Facebook和官网，为OCLSS举办的各类活动撰写推文、制作海报等。欢迎有兴趣提升自己写作、美工、网站设计维护或社交平台运营等技能的同学。\n组织部 组织部负责策划并调度OCLSS每年承办的各种会议。希望参与策划活动的小伙伴们，组织部是一个很好的选择。\n外联部 外联部负责与外部企业建立联系，寻求资源支持。在这里，成员需要与商业公司建立良好沟通，与其谈合作、拉赞助，筹集OCLSS的活动资金。这个部门的小伙伴们不仅能够提升自己的谈判能力，也可以为大家提供科研外的企业资源。如果你具有良好的沟通能力和执行力，欢迎你加入外联部。\n财务部 财务部的主要职责是管理OCLSS银行账号，制定活动预算、记账、报销、开具发票等。财务部需要对细心和有财务知识积累的人，有相关经历或希望积累财务相关能力，欢迎你的加入。\n3.报名方式 报名条件：牛津地区学生学者，生命科学相关者优先。（本科生、硕士、博士、博士后、访问学者、交换生均可报名。）\n报名截止日期：2020年10月30日\n报名链接\n招新咨询： 扫描以下群二维码，会有专人为你解答疑惑。\n"});index.add({'id':2,'href':'/docs/Membership/','title':"Membership",'content':"Membership There are two types of membership: full members and associate members.\nFull members are entitled to free food and drinks offered at the monthly seminars and free attendance at any ad hoc events.\nAssociate members can only attend ad hoc events if there are seats available, and they will have to buy an unsubsidized ticket for each event.\nThe monthly seminars and Friday tea breaks are nevertheless open to the public.\nRegistration fee There are different rates for full membership, depending on when you register (and pay the fee) and if you are a student:\n   Early bird rate (before 31 July 2014):      Staff £15   Student £5       After 31 July 2014      Staff £20   Student £10    To encourage people to join our society, there is no fee for registering as associate members.\nRegistration form To become a member of the society, please click here.\n"});index.add({'id':3,'href':'/docs/Events/','title':"Events",'content':" button { color: white; } h2event{ color: #3273DC;display: inline-block; border: 1px solid #7594B4; border-radius: 25px; padding: 10px 15px 10px 15px }   Ongoing event 🎉 New recruit for 20-21 Michaelmas term is now opening for application, please click the button below to apply. Apply here\n  Future events Several activities have been organized in the past few months, and there are more to come!\nRegular events\n  Monthly seminars\n  We invite two life scientists to give presentations about their research work every month. This month, the presenters are Dr Yiyan Zheng (FER is a plausible novel target for enhancing paclitaxel cytotoxicity in ovarian cancer) and Mr Hanlin Zhang (Autophagy and T cell immunity). They will be presenting at the Weatherall Institute of Molecular Medicine at 5:30pm on 26 September 2014.\n  Friday tea breaks\n  These tea breaks allow life scientists in Oxford to meet, chat and socialize after a week\u0026rsquo;s hard work. The tea breaks are held at the Weatherall Institute of Molecular Medicine at 5pm every Friday.\n  Ad hoc events\n Industrial visit We intend to organize an industrial visit to one or two pharmaceutical companies in September/ October 2014.  Past events So far, ten life scientists have presented their work at the monthly seminars (many thanks for their time and effort!):\n  Dr Veronica Chang (Crystallizing a glycoprotein) and Dr Leyuan Bao (VEGF receptor protein-protein interactions and intracellular signalling in human endothelial cells) on 25 April 2014\n  Dr Xiaowei Zheng (Structural biology – see to believe; top) and Dr Wei Gan (Genetic screening for the risk of type 2 diabetes in Han Chinese; bottom) on 30 May 2014:\n  Dr Shan Gao (Searching for synthetic lethality in cancer; top) and Dr Yingjie Wang (To bind or not to bind – hyaluronan and LYVE-1 signalling in lymphatics; bottom) on on 4 July 2014:\n   Dr Joe Zhu (Coalescent trees and population structures; top) and Dr Qianxin Wu (Deciphering microRNA – target regulation using genome engineering approach; bottom) on 25 July 2014:   Prof Tao Dong (IFITM3 rs12252-C is associated with disease severity in pandemic influenza A H1N1/09 infected Chinese individuals; top) and Dr Chang Zheng (What can we learn from observational studies?; bottom) on 29 August 2014:    Barbecue at Wolfson College on 12 July 2014:\n  News 第26届全英华人生命科学学会顺利线上举行 \u0026ndash; 《英国侨报》\n"});index.add({'id':4,'href':'/docs/Jobs/','title':"Jobs",'content':"  Job vacancies Here you can view the job opportunities referred by our members:\n  Various hospital posts - HOT\n  Various hospital posts are available in Beijing for overseas researchers (see here for details).\n  Senior scientist of viral immunology\n  Janssen is looking for a senior scientist of viral immunology to join their R\u0026amp;D centre in Shanghai (see here for details). If interested, please contact Chris Li directly.\n    "});index.add({'id':5,'href':'/docs/Acknowledgements/','title':"Acknowledgements",'content':"  Acknowledgements We thank the following people for their support to our society:\n Prof Tao Dong (Weatherall Institute of Molecular Medicine, University of Oxford) Dr Shisong Jiang (Department of Oncology, University of Oxford) Dr Jilong Liu (Department of Physiology, Anatomy and Genetics, University of Oxford)    "});index.add({'id':6,'href':'/docs/Contact/','title':"Contact",'content':"  Contact information If you have any questions, please feel free to contact us at oxlifescisoc@gmail.com.\nWe welcome anyone working in life sciences in Oxford to join us!\u0026rsquo;\n  "});index.add({'id':7,'href':'/docs/Members/','title':"Members",'content':" .member{ display: block; margin: auto; }  成员自我介绍 会长 王颖捷\n王颖捷，纽卡斯尔大学硕士/博士，毕业后在伯明翰大学和牛津大学做博士后研究。我目前的研究兴趣是了解遗传性心肌疾病的炎症反应，包括肥厚性和扩张型心肌病（即HCM和DCM）。自2013年来，和志同道合的朋友们一起创办了牛津华人生命科学协会，致力于为在牛津生命科学领域学习工作的学生学者创业者们提供一个交流合作的平台。\n副会长 杜越\n杜越，牛津大学临床医学系WTP博士后，美国\u0026amp;欧洲基因与细胞基因治疗协会成员， ASGCT卓越研究奖得主。研究领域从兽医到体细胞克隆，从基因编辑到肺部疾病的基因疗法开发与临床转化；曾带领团队开发针对免疫力低下人群的首个抗新冠病毒感染的免疫预防。早C晚A，喜看闲书唱闲歌，且及时当勉励。现任OCLSS副会长，在协会中主要服务支持创业与外联板块发展，力求做好传递者与桥梁，把更多的知识与信息通过OCLSS的窗口与大家分享，很高兴你能来。\n副会长/学生主席 李奇点\n大家好，我叫李奇点，目前是牛津大学化学系博四，主要研究镧系元素在生物成像方面的应用。旅英7年，在伯明翰大学完成本科，在帝国理工完成硕士学业。去年在华大基因和广发期货做过实习。学习和工作之余，参加过一些创投大赛。平时喜欢看书、学日语，最近还迷上了用RAP学英文。\n 组织部 部长 刘赓\n刘赓，现任学会组织部部长。 牛津大学Oncology的博后，在ORCRB（俗称绿楼）工作。主要研究方向是转录因子E2F-Rb信号通路调控RNA编辑剪切从而影响肿瘤免疫。业余爱好：下厨（黑暗料理），追剧（英剧美剧），运动（徒步旅行）。希望大家多多支持和参与学会的各项活动，也欢迎大家对活动的形式和内容提出各类建议和意见！\n成员 邓司伟\n邓司伟，DPhil Molecular and Cellular Medicine 一年级，来自Wolfson College，部门位于NDORMS Botnar Research Centre，研究胰腺癌干细胞表观遗传机制，主要承担各种生物信息学分析。爱吃爱睡，还爱好制作黑暗料理。\n陈宇扬\n陈宇扬，牛津大学生物学专业读大四，来自New College主要研究哺乳动物基因组中的残留逆转录病毒片段在免疫系统中的作用。工作之外，爱好古典音乐、旅行、阅读、运动。希望能够在组织学会的活动中，认识更多志同道合的朋友。\n朱烨玄\n朱烨玄，在牛津大学 Biomedical Sciences 读大二，来自St Anne’s College。目前正在积极地探索自己的学术兴趣。课余时间爱好看杂书和读古诗。希望能向协会中的前辈们多多学习，也希望大家能多多关注生物科技这个领域。\n 秘书处 秘书长 孙天依\n孙天依，牛津大学药理学系博后，研究方向为PdCM（Pnmt+心肌细胞亚群）的特性结构和生理病理功能。我乐观积极，喜欢与人交流，每当和不同学科不同背景的人交流，与不同的人进行思维碰撞，总能让我多一分对世界的认知与喜爱。除此之外，我还喜欢旅行和体验生活，积极参与各个活动。很荣幸可以加入OCLSS，现任秘书长，希望可以通过组织不同类型的研讨会、创业论坛、分享会和讲座，让更多人了解这个组织，从中收获很多。\n成员 郭伊妮\n大家好！我是正在学习背贯口的郭伊妮，在和Trinity一墙之隔的Balliol College读工程。日常追番打游戏，人越菜瘾越大。热爱选秀和Kpop。虽然爱看喜欢的乐队的live，但同时也是深度民乐爱好者，（作为一个只会中阮的菜鸡）深爱着琵琶和杨琴，晚上最喜欢做的事情就是看星星，认星座。很开心能够认识大家，成为协会秘书处的一员！希望接下来的日子可以学到更多的知识，和大家一起共创辉煌！！\n马子奇\n马子奇 (Jackie Ma, M.D., M.Sc)，牛津心血管医学部访问学生。在中山一院完成住院医师阶段，荣获6封患者感谢信，期间兼任团总支副书记。曾参与多个国家级课题，广泛涉及基础、临床研究（心血管、代谢、呼吸）。\n宋怡璇\n宋怡璇, Biochemistry 4th year from St Peter\u0026rsquo;s College, 目前在Pharmacology department Platt Lab 研究Mechanistic similarity between lysosomal storage disease and mycobacteria infection。业余热爱旅行和摄影\n 创业部 部长/财政长 张叶川\n牛津生物学工程系博士三年级，研究方向ASL核磁脑部血流量值计算问题。对生物医药方向的创业公司和相关投资很感兴趣\n成员 石柳\n石柳，牛津大学精神科系博士后，iCURE创业项目奖得主。研究方向专注于开发血液检测用于阿尔茨海默症的早期诊断。爱好看书，电影及徒步。现加入创业部，在协会中主要支持创业板块发展，尤其是如何将科研成果进行产业转化，将更多的资源通过OCLSS的平台与大家分享。\n李思琪\n李思琪，医学院肿瘤系博士二年级，不会说方言的安徽合肥人。研究方向是核酸药物在肿瘤中的传递与治疗。对研究成果的转化与早期投资创业依然在学习探索中，希望和OCLSS同时有专业素质和综合能力的小伙伴们一起学习成长。\n钱颀楠\n钱颀楠, 牛津大学生物细胞部门博士生,研究方向为肉瘤细胞疗法研发。 平时喜欢健身打球,旅游电影。通过加入OCLSS创业部, 我希望为创业板块的发展作出自己的贡献,不断通过OCLSS的平台为大家提供更好的创业环境。\n朱亦巅\n朱亦巅正在就读博士二年级并进行疫苗相关的课题研究，感兴趣接触学习医药方面的项目。爱好有搭建hifi系统等。\n 外联部 部长 张盛盼\n我是张盛盼，就读于牛津大学病理系，生物医学二年级博士一枚，研究方向是HIV-1在细胞间传播的分子机制及其对免疫缺陷和炎症等系列并发症治疗的应用。工作上与实验佛系爱恨纠缠，生活中对一切新鲜事物充满好奇，喜欢旅行冒险尝试一些刺激运动。很开心能通过OCLSS这个平台与大家合作交流。\n成员 皮力\n皮力，2020 级 Nuffield Department of Medicine 流行病学方向博士生，St Hugh‘s College。帝国理工/华西校友。研究方向是传染病建模，但最近沉迷塞尔达。期待新一年和大家的合作！\n王小凡\nHello, 我是爱旅行爱音乐爱化学的Emily 王小凡。就读过G5里面的三个学校UCL, IC \u0026amp; OX现在是牛津大学Dphil inorganic Chemistry 二年级在读。研究课题是EPSRC合作项目：镧系金属核磁造影剂在低氧肿瘤成像和治疗上的应用。非常高兴加入OCLSS外联部，希望大家多多参与OSLSS今年的活动！\n陈曦\n你好😊，我是陈曦，航院17级流体力学硕士。目前在牛津生物医学工程专业读博士二年级，st hildas college\n 新媒体部 朱敏茵 (Sandy)\n朱敏茵(Sandy), 新媒体部部长。我于2013年在伦敦大学学院（UCL）获得了生理和药理学位。之后，在伦敦玛丽女王大学完成了硕博连读。目前博后第三年，研究方向主要是心脏医学。爱好美食和郊游。\n郑健青\n获肯尼迪奖学金资助于牛津大学DPhil第三年在读，此前获海伦哈姆林奖学金资助MRes毕业于帝国理工。研究领域包括人工智能于生物医学分析、术前诊疗及手术导航的应用。于国际会议及SCI期刊发表相关研究成果十余篇。在科研转化方面有多项专利。爱好唱K，健身，电影。\n赵玉\n我是新媒体部的赵玉。专业是生物医学，研究方向为肿瘤的放化疗，以及免疫治疗。曾经参与过非小细胞肺癌的放疗增敏研究，目前的主要研究方向为恶性胸水的个体化免疫治疗。\n吴姿诺\n吴姿诺，新媒体部成员。目前为牛津大学Biochemistry本科大一学生。爱好不多，练舞十余载，平日也好抱着只小吉他哼哼曲儿。主要负责公众号推文的设计和排版，如果有任何建议与意见请尽管联系哦～\n 过往成员介绍 梁竹\nDphil in Clinical Medicine，exeter college，专注炎症小体在神经退行性疾病中的研究。（他很神秘不愿意透露过多信息，想多了解可以关注我们公众号）。\n陈欣雨\nhello 大家好，我是陈欣雨，担任宣传的职位，主要负责管理公众号和发送推文的工作。日常是刷剧刷电影发呆散步看杂书打羽毛球，最近也开始发展一些户外运动了。喜欢的电影很杂，一个人安静的时候最喜欢看战争片或者纪录片，或者听着歌四处走走。想学会调酒做饭尤克里里，想去冰岛稻城阿那亚，疫情结束后一定要去伦敦看音乐剧。我喜欢尝试不同领域的新事物，如果有什么想分享的可以来找我，我特别乐意去了解。\n杜越\n杜越，爱丁堡大学博士，牛津大学博士后，美国基因治疗和细胞治疗协会（ASGCT）成员，英国囊性纤维肿基因治疗组织（GTC）成员，主要科研方向是基因编辑和治疗现任职于英国牛津大学医学院。主导了多项科研项目，研究成果多次在国际会议展示，SCI学术发表在【 Molecular Therapy 】【 Journal of Pineal Research 】等核心期刊。在科研成果转化方面，带领团队获得华为杯英国帝国理工大学创新大赛最佳路演奖、中国教育部“春晖杯”创业创新大赛优胜奖、南京六合创业创新大赛二等奖等。\n陈劲廷\n大家好呀，我叫陈劲廷，化学学生。平时有空也会研究下做饭和摄影，希望能和学长学姐多学习交流。\n秦岭\n大家好，我叫秦岭 (但我不负责中国南北气候差异，后院也没有野生大熊猫)。Christ Church 学院，牛津 Clinical Medicine 博士第二年在读，研究方向为病毒入侵宿主分子机制。业余爱好一切棋类和球类运动 (篮球除外)，偶尔玩玩魔方。\n "});index.add({'id':8,'href':'/docs/Partnership/','title':"商业合作",'content':"请填写以下商业合作表  "});index.add({'id':9,'href':'/docs/Events/form/','title':"Form",'content':" "});index.add({'id':10,'href':'/docs/Events/schedule/','title':"Schedule",'content':"The Programme for the 26th Annual Conference of the Chinese Life Scientists Society in the UK 8:30 am (British Summer Time) 19th, September 2020\nZoom meeting online\n OPENING SESSION\n08:30 – 08:40 Opening remarks - Prof. Hua Ye (Associate Professor in Engineering Science, Deputy Director of CRMI Technology Centre, University of Oxford)\n08:40 – 08:50 Speech from the special guest - Mr. Sunan Jiang (Minister Counsellor for Science and Technology Affairs, Chinese Embassy in the UK)\n08:50 – 09:00 Welcome speech from the University of Oxford - Prof. Xin Lu (FMedSci, FRS, Professor of Cancer Biology, Director of Ludwig Cancer Research, University of Oxford)\n SESSION 1 - Neuroscience\n09:00 – 09:40 Plenary speech: Computational approach to brain disease\n- Prof. Jianfeng Feng (Professor of Computational Psychiatry, Warwick University and Fudan University)\n09:40 – 10:00 Invited speech 1: Synaptic transmission dynamics underlying hippocampal sharp-wave ripple oscillations in vivo\n- Dr. Jian Gan (Group Leader in UK Dementia Research Institute, University of Edinburgh)\n10:00 – 10:20 Invited speech 2: The impact of biomolecular condensates on local protein synthesis and axonal health\n- Dr. Julie Qiaojin Lin (Sir Henry Wellcome Research Fellow, Department of Clinical Neurosciences, University of Cambridge)\n10:20 – 10:40 Invited speech 3: Novel tau filament fold in corticobasal degeneration, a four-repeat tauopathy\n- Dr. Wenjuan Zhang (Post-doctoral Fellow, MRC Laboratory of Molecular Biology, University of Cambridge)\n10:40 – 11:00 Invited speech 4: Blood Biomarkers for the diagnosis of Alzheimer\u0026rsquo;s disease\n- Dr. Liu Shi (Senior Postdoc Researcher, Department of Physiology, Anatomy and Genetics, University of Oxford)\n11:00 – 11:20 Coffee break\n SESSION 2 - Bioengineering \u0026amp; Biotechnology\n11:20 – 12:00 Plenary speech: Development of LAMP-based COVID-19 rapid testing kit\n- *Prof. Zhanfeng Cui* (FREng, CEng, MIPEM, CSci, FIChemE, David Pollock Professor of Chemical Engineering, Director of CRMI Technology Centre, Founding Director of Oxford Suzhou Centre for Advanced Research, OSCAR)\n12:00 – 12:20 Invited speech 1: Image2Mech: fill the gap between imaging and robotics in surgery\n- *Dr. Xiao-Yun Zhou* (Senior Research Scientist, PAII. Inc.)\n12:20 – 12:40 Invited speech 2: Bisulfite-free, base-resolution, direct sequencing of DNA methylaiton\n- *Dr. Yibin Liu* (Post-doctoral Fellow, Ludwig Cancer Research, University of Oxford)\n12:40 – 13:00 Invited speech 3: INSIGHT (Isothermal NASBA-Sequencing based hIGH-throughput Test): a two-stage COVID-19 testing strategy\n- Dr. Qianxin Wu (Staff Scientist at Wellcome Sanger Institue)\n13:00 – 13:20 Invited speech 4: 3D Printing and Bioinspired-Fabrication towards Replicating Tissue Functions\n- Dr. Yan Yan Shery Huang (Assistant Professor, Department of Engineering, University of Cambridge)\n13:20 – 14:00 Lunch break\n14:00 – 14:30 COVID-19 Panel discussion: What is the impact of coronavirus?\n SESSION 3 - Big Data\n14:30 – 15:10 Plenary speech:Big data and precision medicine: hypes or hopes?\n- Prof. Zhengming Chen (Professor of Epidemiology and Director of China Programmes, University of Oxford)\n15:10 – 15:30 Invited speech 1: Machine learning for large-scale cardiac image analysis\n- Dr. Wenjia Bai (Lecturer in Artificial Intelligence in Medicine, Data Science Institute, Imperial College London)\n15:30 – 15:50 Invited speech 2: Machine learning challenges in pharmacogenomics\n- Dr. Dennis Wang (Senior Lecturer in Genomic Medicine and Bioinformatics, Sheffield Institute of Translational Neuroscience and Department of Computer Science, University of Sheffield)\n15:50 – 16:10 Invited speech 3: Glucose management using Artificial Intelligence\n- Dr. Kezhi (Ken) Li (Lecturer at Institute of Health Informatics, University College London)\n16:10 – 16:30 Coffee break\n SESSION 4 - Infection \u0026amp; Immunity\n16:30 – 16:50 Invited speech 1: Genetics-led immunological research for novel disease mechanisms and drug targets\n- Dr. Liye Chen (Principal Investigator, Nuffield Department of Orthopaedics, Rheumatology and Musculoskeletal Sciences, University of Oxford)\n16:50 – 17:10 Invited speech 2: Structure and distributions of SARS-CoV-2 spike proteins on intact virions\n- Dr. Zunlong Ke (Post-doctoral Fellow, MRC Laboratory of Molecular Biology, University of Cambridge)\n17:10 – 17:30 Invited speech 3: The origins and relatedness structure of mixed infections vary with local prevalence of P. falciparum malaria\n- Dr. Sha Zhu (Senior statistical analyst)\n17:30 – 18:10 Plenary speech: Broad and strong SARS-COV-2 specific memory T cell responses detected in UK patients recovered from COVID-19\n- Prof. Tao Dong (Professor of Immunology, MRC Human Immunology Unit, Founding Director, Oxford, CAMS-Oxford joint International Centre for Translational Immunology, and Chinese Academy of Medical Science Oxford Institute, University of Oxford)\n CLOSING SESSION\n18:10 – 18:30 Award announcing \u0026amp; closing remarks from current CLSS-UK president - Dr. Rongjun Chen (Reader in Biomaterials Engineering, Imperial College London)\n To register this event, please click here "});index.add({'id':11,'href':'/docs/example/hidden/','title':"Hidden",'content':"This page is hidden in menu Quondam non pater est dignior ille Eurotas Latent te facies Lorem markdownum arma ignoscas vocavit quoque ille texit mandata mentis ultimus, frementes, qui in vel. Hippotades Peleus pennas conscia cuiquam Caeneus quas.\n Pater demittere evincitque reddunt Maxime adhuc pressit huc Danaas quid freta Soror ego Luctus linguam saxa ultroque prior Tatiumque inquit Saepe liquitur subita superata dederat Anius sudor  Cum honorum Latona O fallor in sustinui iussorum equidem. Nymphae operi oris alii fronde parens dumque, in auro ait mox ingenti proxima iamdudum maius?\nreality(burnDocking(apache_nanometer), pad.property_data_programming.sectorBrowserPpga(dataMask, 37, recycleRup)); intellectualVaporwareUser += -5 * 4; traceroute_key_upnp /= lag_optical(android.smb(thyristorTftp)); surge_host_golden = mca_compact_device(dual_dpi_opengl, 33, commerce_add_ppc); if (lun_ipv) { verticalExtranet(1, thumbnail_ttl, 3); bar_graphics_jpeg(chipset - sector_xmp_beta); }  Fronde cetera dextrae sequens pennis voce muneris Acta cretus diem restet utque; move integer, oscula non inspirat, noctisque scelus! Nantemque in suas vobis quamvis, et labori!\nvar runtimeDiskCompiler = home - array_ad_software; if (internic \u0026gt; disk) { emoticonLockCron += 37 + bps - 4; wan_ansi_honeypot.cardGigaflops = artificialStorageCgi; simplex -= downloadAccess; } var volumeHardeningAndroid = pixel + tftp + onProcessorUnmount; sector(memory(firewire + interlaced, wired)); "});index.add({'id':12,'href':'/categories/','title':"Categories",'content':""});index.add({'id':13,'href':'/docs/','title':"Docs",'content':""});index.add({'id':14,'href':'/','title':"Introduction",'content':" h2event{ color: #3273DC;display: inline-block; border: 1px solid #7594B4; border-radius: 25px; padding: 10px 15px 10px 15px }   About us Several members of the committee helped to organize the very successful 19th Annual Meeting of the Chinese Life Scientists Society in the UK which took place in Oxford in 2013 (for details, please click here). They believed that a permanent platform was needed for Chinese life scientists in Oxford to meet regularly and exchange ideas, and therefore established this society.\nThe aims of this society are:\n To bring together researchers with different areas of expertise in life sciences in Oxford To provide a platform for Chinese life scientists in Oxford to meet, exchange ideas and establish research collaborations  We welcome anyone working in life sciences in Oxford to join us! Hello World\nCommittee  Advisors (in surname order): Prof. Zhanfeng Cui, Prof Tao Dong, Dr Shisong Jiang, Dr Jilong Liu Committee Members (in surname order): Dr Leyuan Bao, Ms Elizabeth Huang, Dr Yuan Jenq Lui, Dr Yingjie Wang, Mr Hanlin Zhang  "});index.add({'id':15,'href':'/tags/','title':"Tags",'content':""});})();